questionvariables.text:
pm1:rand([-1,1]);
aa:rand(8)+1;
pm2:rand([-1,1]);
bb:rand(8)+1;
quest:expand((x-pm1*aa)*(x-pm2*bb));
ta:{pm1*aa,pm2*bb};

/*Worked solution codes*/
ans:{ans1,ans2};
err:if cardinality(intersect(ans,ta))>0 then 1 else 0;
errcorr:if cardinality(intersect(ans,ta))>0 then listify(intersect(ans,ta))[1] else "";
blb:if -(pm1*aa+pm2*bb)<0 then "(" else "";
brb:if -(pm1*aa+pm2*bb)<0 then ")" else "";
clb:if pm1*aa*pm2*bb<0 then "(" else "";
crb:if pm1*aa*pm2*bb<0 then ")" else "";

feedbackvariables.text:
ans:{ans1,ans2};
err:if cardinality(intersect(ans,ta))>0 then 1 else 0;
errcorr:if cardinality(intersect(ans,ta))>0 then listify(intersect(ans,ta))[1] else "";
blb:if -(pm1*aa+pm2*bb)<0 then "(" else "";
brb:if -(pm1*aa+pm2*bb)<0 then ")" else "";
clb:if pm1*aa*pm2*bb<0 then "(" else "";
crb:if pm1*aa*pm2*bb<0 then ")" else "";
